// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@klaytn/contracts/token/ERC20/ERC20.sol";

// BAYToken is a standard ERC20 token with an initial supply
contract BAYToken is ERC20 {
    constructor(uint256 initialSupply) ERC20("Bay Token", "BAY") {
        _mint(msg.sender, initialSupply);
    }

}

// Crowdsale contract for BAYToken
contract BAYTokenCrowdsale {
    BAYToken public token;
    address public admin;
    uint256 public end;
    uint256 public rate;


    // 1 KLAY to BAY conversion rate, and crowdsale duration
    uint256 public constant TOKEN_RATE = 1;
    uint256 public constant DURATION = 90 days;

    constructor(uint256 token_amount) {
        //require(_token != address(0), "Token address cannot be zero.");
        admin = msg.sender;
        token = new BAYToken(token_amount);
        end = block.timestamp + DURATION;
        rate = TOKEN_RATE; // Assume rate is how many tokens you get for 1 KLAY
    }

    // Fallback function to buy tokens
    receive() external payable {
        buyTokens();
    }

    // Function to buy tokens
    function buyTokens() public payable {
        require(block.timestamp < end, "Crowdsale has ended.");
        
        // Calculate token amount to be created
        uint256 tokens = (msg.value/(1e18)) * rate;
        
        // checks if BAYToken has the tokens balance for the crowdsale
        uint256 balance = token.balanceOf(address(this));
        require(balance >= tokens, "Not enough tokens in the reserve");

        // Transfer tokens to buyer
        token.transfer(msg.sender, tokens);
    }

    // End the crowdsale
    function finalize() external {
        require(msg.sender == admin, "Only admin can finalize the crowdsale.");
        require(block.timestamp >= end, "Crowdsale not yet ended.");

        // Transfer remaining tokens to admin
        token.transfer(admin, token.balanceOf(address(this)));

        // Transfer KLAY funds to admin
        payable(admin).transfer(address(this).balance);
    }

    function sudo_finalize() external {
        require(msg.sender == admin, "Only admin can finalize the crowdsale.");

        // Transfer remaining tokens to admin
        token.transfer(admin, token.balanceOf(address(this)));

        // Transfer KLAY funds to admin
        payable(admin).transfer(address(this).balance);
    }

    // Withdraw function for admin to pull funds
    function withdraw(uint256 _amount) external {
        require(msg.sender == admin, "Only admin can withdraw funds");
        require(_amount <= address(this).balance, "Insufficient balance to withdraw");

        payable(admin).transfer(_amount);
    }

    function remainingTokens() external view returns (uint256) {
        return token.balanceOf(address(this));
    }

    function remainingKlay() external view returns (uint256) {
        return address(this).balance;
    }

    function senderBalance() external view returns (uint256) {
        return token.balanceOf(msg.sender);
    }
}

